import './List.css'
import Checkbox from '../Checkbox/Checkbox';
import React, { useState, useEffect } from 'react';

const List = () => {
    const [data, setData] = useState(null);

    useEffect(() => {
      const fetchData = async () => {
        try {
          const response = await fetch('http://reshade.io:1234');
          const result = await response.json();
          setData(result);
        } catch (error) {
          console.error('Error fetching data:', error);
        }
      };
  
      fetchData();
    }, []);
  
    return (
      <div>
        {data && (
          <ChildComponent rarity={data.rarity} hexcode={data.hexcode} />
        )}
      </div>
    );
  };
  
  const ChildComponent = ({ rarity, hexcode }) => {
    return (
      <div>
        <p>Rarity: {rarity}</p>
        <p>Hexcode: {hexcode}</p>
      </div>
    );
  };

export default List;
